    false,nt"url": null,nt"notes": "Seychelles coral oxygen-18 time series,
    data are monthly values of d18O from July 1846 to February 1995 from a 3-m Porites
    lutea coral colony collected from Beau Vallon Bay (4 degrees 36.97 S, 55 degrees
    E, 7m water depth), Mahe Island, Republic of the Seychelles, in July 1995. Stable
    isotopes were measured on untreated coral samples at the Scripps Institution of
    Oceanography by D. Hunter and C. Charles on a Finnigan MAT-252 gas source mass spectrometer
    with an automatic carbonate preparation device. Values are in standard per mil notation
    relative to PDB. Measurement precision is better than 0.08. Ages were derived from
    annual variations in d18O in conjunction with annual density banding.",nt"owner_org":
